import faFrown from "@fortawesome/fontawesome-free-solid/faFrown";
import faSmile from "@fortawesome/fontawesome-free-solid/faSmile";

const UserCart = props => {
  const [state, setState] = useState({
    loading: true,
    total: 0,
    success: false,
    amount: false
  });

  useEffect(() => {
    let cartItem = [];
    let user = props.user;

    console.log(user);
  })

  return (
    <UserLayout>
      <div>Cart</div>
